export function getBatteryImage(battery_soc) {
  if (battery_soc == 100) {
    return getBase64Data("battery-5");
  } else if (battery_soc >= 80) {
    return getBase64Data("battery-4");
  } else if (battery_soc >= 60) {
    return getBase64Data("battery-3");
  } else if (battery_soc >= 40) {
    return getBase64Data("battery-2");
  } else if (battery_soc >= 20) {
    return getBase64Data("battery-1");
  } else {
    return getBase64Data("battery-0");
  }
}

export function getBase64Data(image_name) {
  switch (image_name) {
    case "arrow":
      return `data:image/png;base64,`;
    case "battery-0":
      return `data:image/png;base64,`;
    case "battery-1":
      return `data:image/png;base64,`;
    case "battery-2":
      return `data:image/png;base64,`;
    case "battery-3":
      return `data:image/png;base64,`;
    case "battery-4":
      return `data:image/png;base64,`;
    case "battery-5":
      return `data:image/png;base64,`;
    case "grid":
      return `data:image/png;base64,`;
    case "home-normal":
      return `data:image/png;base64,`;
    case "inverter":
      return `data:image/png;base64,`;
    case "parallel-inverter":
      return `data:image/png;base64,`;
    case "solar":
      return `data:image/png;base64,`;
    default:
      return ``;
  }
}
